$( window ).resize(function() {

	// Resize home listing
	var offsetheight =  $('#home .header').height()+$('#home .name').height()+$('#footer').height()+(parseInt($('#home .name').css('padding-top'))*2);
	if( $(window).width() > 600 ) offsetheight = $('#home .name').height()+(parseInt($('#home .name').css('padding-top'))*2);
	$('#home .content').css('height',($('#home').height()-offsetheight)+"px");
	
	// Resize prize listing
	offsetheight =  $('#prize .header').height()+$('#prize .tabs').height()+$('#footer').height()+$('#prize .name').height()+(parseInt($('#prize .name').css('padding-top'))*2);
    if( $(window).width() > 600 ) offsetheight =  $('#prize .tabs').height()+$('#prize .name').height()+(parseInt($('#prize .name').css('padding-top'))*2);
    $('#prize .tabpanel').css('width',$('#prize').width()+"px");
    $('#prize .tabpanel').css('height',($('#prize').height()-offsetheight)+"px");
	
});

function AppInit(){
    DebugOut('initing app');
	panel['prize'] = new Prize();
    panel['home'] = new Home();
	panel['checkin'] = new Checkin();
	panel['checkindetail'] = new CheckinDetail();
	panel['location'] = new Location();
	panel['userlocation'] = new UserLocation();
	panel['userprofile'] = new UserProfile();
	panel['userlogin'] = new UserLogin();
	panel['info'] = new Info();
	panel['locationoptions'] = new LocationOptions();

    panel['home'].Load();
}

function AdInit(){
	admob.createBannerView(
    	{
    		'publisherId': 'ca-app-pub-9860806024628930/2903343809',
    		'adSize': admob.AD_SIZE.BANNER
    	},
    	HandleAdSuccess,
    	HandleAdFail
	);
}

function HandleAdSuccess(){
	DebugOut('ad init success.');
	admob.requestAd(
	     {
	       'isTesting': false,
	       'extras': {
	         'color_bg': 'AAAAFF',
	         'color_bg_top': 'FFFFFF',
	         'color_border': 'FFFFFF',
	         'color_link': '000080',
	         'color_text': '808080',
	         'color_url': '008000'
	       },
	     },
	     function(){DebugOut('handle ad success!');},
	     function(){DebugOut('handle ad fail');}
	 );
}

function HandleAdFail(){
	DebugOut('ad init failed.');
}

